int buzzerPin = 8;      // Pin where the buzzer is connected

// Function to play Morse code
void playMorseCode(char c) {
  int i;
  for (i = 0; i < strlen(morseCodeLookup[c]); i++) {
    char symbol = morseCodeLookup[c][i];
    if (symbol == '.') {
      tone(buzzerPin, 1000, dotDuration); // 1000 Hz tone for dot
      delay(dotDuration);
    } else if (symbol == '-') {
      tone(buzzerPin, 1000, dotDuration * 3); // 1000 Hz tone for dash
      delay(dotDuration * 3);
    }
    delay(dotDuration); // Space between dots and dashes
  }
  delay(dotDuration * 3); // Space between letters
}

